import React from 'react';

const Addactivity = () => {
  return (
    <div style={styles.page}>
      <h1>เพิ่มกิจกรรม</h1>
      <form>
        <input type="text" placeholder="ชื่อกิจกรรม" style={styles.input} /><br />
        <textarea placeholder="รายละเอียดกิจกรรม" style={styles.textarea}></textarea><br />
        <button type="submit">เพิ่ม</button>
      </form>
    </div>
  );
};

const styles = {
  page: {
    padding: '20px',
  },
  input: {
    width: '100%',
    padding: '10px',
    marginBottom: '10px',
  },
  textarea: {
    width: '100%',
    height: '100px',
    padding: '10px',
    marginBottom: '10px',
  },
};

export default Addactivity;
